        private void ShowPopup(string message, string title, Point location, Color bgColor, Color borderColor, int borderThickness)
        {
            Thread t = new Thread(() =>
            {
                Form popup = new Form();
                popup.StartPosition = FormStartPosition.Manual;
                popup.Location = location;
                popup.Size = new Size(250, 120);
                popup.Text = title;
                popup.BackColor = bgColor;

               
                popup.Paint += (s, e) =>
                {
                    using (Pen pen = new Pen(borderColor, borderThickness))
                    {
                        e.Graphics.DrawRectangle(pen,
                            borderThickness / 2, borderThickness / 2,
                            popup.ClientSize.Width - borderThickness,
                            popup.ClientSize.Height - borderThickness);
                    }
                };

                Label lbl = new Label();
                lbl.Text = message;
                lbl.Dock = DockStyle.Fill;
                lbl.TextAlign = ContentAlignment.MiddleCenter;
                popup.Controls.Add(lbl);

                Button okBtn = new Button();
                okBtn.Text = "OK";
                okBtn.Dock = DockStyle.Bottom;
                okBtn.Click += (s, e) => popup.Close();
                popup.Controls.Add(okBtn);

                Application.Run(popup);
            
            });

            t.SetApartmentState(ApartmentState.STA);
            t.Start();
        }

